  public static bool IsSupportedPdfName(string name)
  {
    return SystemFontAdobeGlyphList.map.ContainsKey(name);
  }

  public static char GetUnicode(string names)
  {
    if (names == null)
      return char.MinValue;
    int length = names.IndexOf('.');
    if (length > 0)
      names = names.Substring(0, length);
    string[] strArray = names.Split('_');
    return strArray.Length > 0 ? SystemFontAdobeGlyphList.GetUnicodeForName(strArray[0]) : char.MinValue;
  }

  private static char ParseHex(string hex)
  {
    try
    {
      return (char) int.Parse(hex, NumberStyles.HexNumber);
    }
    catch
    {
      return char.MinValue;
    }
  }

  private static char GetUnicodeForName(string name)
  {
    char unicodeForName;
    if (SystemFontAdobeGlyphList.map.TryGetValue(name, out unicodeForName))
      return unicodeForName;
    if (name.StartsWith("uni"))
    {
      int startIndex = 0;
      name = name.Substring(3);
      return startIndex + 4 <= name.Length ? SystemFontAdobeGlyphList.ParseHex(name.Substring(startIndex, 4)) : char.MinValue;
    }
    return name.StartsWith("u") ? SystemFontAdobeGlyphList.ParseHex(name.Substring(1, name.Length - 1)) : throw new ArgumentException("The encoding is not supported.");
  }
